import React from 'react';

const AdminDashboard = () => {
  return (
    <div>
      <h1>Admin Dashboard</h1>
      <nav>
        <ul>
          <li>제품 관리</li>
          <li>주문 관리</li>
          <li>사용자 관리</li>
          <li>통계</li>
        </ul>
      </nav>
      {/* 관리 기능을 위한 컴포넌트를 여기에 추가 */}
    </div>
  );
};

export default AdminDashboard;
